package com.example.propert_app.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class AgentModel {    @SerializedName("status")    @Expose    public Integer status;    @SerializedName("message")    @Expose    public String message;    @SerializedName("data")    @Expose    public Data data;    public AgentModel(Integer status, String message, Data data) {        this.status = status;        this.message = message;        this.data = data;    }    public class Data {        @SerializedName("users")        @Expose        public List<User> users = null;        public Data(List<User> users) {            this.users = users;        }    }    public static class User {        @SerializedName("user_id")        @Expose        public Integer userId;        @SerializedName("name")        @Expose        public String name;        @SerializedName("profile")        @Expose        public String profile;        public User(Integer userId, String name, String profile) {            this.userId = userId;            this.name = name;            this.profile = profile;        }    }}